import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button, Image} from 'react-bootstrap';
import logo from '../../res/23619.jpeg';
import './home.css';
import LeafsComponents from './subcomponents/LeafsComponents';
const Home = () => {
  return (
    <div style={{position: 'relative'}}>
      <img object-fit="contain" src={logo} class="sliderImage" />
      <LeafsComponents />
      <div
        style={{
          justifyContent: 'center',
          justifyItems: 'center',
          display: 'flex',
        }}
      >
        <Card style={{width: '90%', margin: 20}}>
          <Card.Header as="h5">EXPLORE CANADA</Card.Header>
          <Form
            inline
            style={{
              paddingLeft: 20,
              paddingRight: 20,
              paddingTop: 10,
              paddingBottom: 10,
            }}
          >
            <Row style={{flexDirection: 'row', flex: 1}}>
              <Form.Control
                type="text"
                placeholder="SEARCH BY CITY NAME"
                style={{
                  flex: 1.2,
                  marginRight: 20,
                  marginLeft: 20,
                }}
              />
              <Form.Label
                style={{fontSize: 14, fontWeight: 'bold', marginRight: 10}}
              >
                Check Inss
              </Form.Label>

              <Form.Group
                inline
                controlId="formGroupCheckIn"
                style={{marginLeft: 10, flex: 1}}
              >
                <Form.Label
                  style={{fontSize: 14, fontWeight: 'bold', marginRight: 10}}
                >
                  Check In
                </Form.Label>
                <Form.Control type="date" placeholder="Start Date" />
              </Form.Group>
              <Form.Group
                inline
                controlId="formGroupCheckout"
                style={{marginLeft: 10, flex: 1}}
              >
                <Form.Label
                  style={{fontSize: 14, fontWeight: 'bold', marginRight: 10}}
                >
                  Check Out
                </Form.Label>
                <Form.Control type="date" placeholder="End Date" />
              </Form.Group>
              <Button style={{marginLeft: 20, marginRight: 20, height: 40}}>
                {' '}
                Search
              </Button>
            </Row>
          </Form>
        </Card>
      </div>
    </div>
  );
};
export default Home;
